@pivoine_signature has created those classic shorts to go along with their Peaky vests and blouses and I couldn't be more excited to wear this style in summer too! I think it's such a clever combo and I highly recommend you to check out their amazing androgynous pieces 🤎 #YourVintageSoul

Have you ever been on a date with yourself? I love doing that on a regular basis, but a few years ago it was quite a challenge for me to even think about it!
@sondeflor is all about courage and inspiration this month with their JULY IT campaign, inviting us to share something new or challenging while wearing their beautiful dresses – and I wanted to talk about this specific topic 🤍
As someone who only has a small circle of friends, who mostly live far away, I felt like I always missed out because I had that socially fear integrated that going to a café or the cinema alone must come across as weird. Until I realized that it's not true at all. Because you know what? People usually don't care and even if they do, why should we let them influence us? In fact, while I was seeing other people going on dates with themselves, I thought: "Wow, they are so cool! I want that as well!" Being able to go on those dates is one of the best things to boost your confidence and it brings you into harmony with yourself. Of course, it's still incomperable to share those activities with loved ones but to know you could also do it by yourself and be happy, is such a relief. So one day I overcame my fear and I just did it or to say it in @sondeflor's words this month: I JULY IT! One of my best succeeded challenges and you should try it too, if you haven't yet 🤍 #MyJulyStory #YourVintageSoul
